import React, {Component} from 'react';

export default class Optionbar extends Component{
    render(){
        return(
            <div  className='mt-5'>
                <h6>Select Brands</h6>
                <button className='btn btn-primary m-1'>Redmi</button>
                <button className='btn btn-primary m-1'>Realme</button>
                <button className='btn btn-primary m-1'>Nokia</button>
                <button className='btn btn-primary m-1'>Samsung</button>
                <button className='btn btn-primary m-1'>OnePlus</button>
                <button className='btn btn-primary m-1'>Motorola</button>
            </div>
        );
    }
}
